    <head>

        <style>
            
            /* Base css */

            :root {
                --sans-serif: "Trebuchet MS", "Lucida Sans Unicode", "Lucida Grande", "Lucida Sans", Arial, sans-serif;
                --serif: "Times New Roman", Times, serif;
                --white: #ffffff;
                --black: #000000;
                --base-font-color-light: #555555;
                --base-border-color: #333333;
                --base-background-color-light: #eeeeee;
                --base-background-color-dark: #dddddd;
            }

            * {
                padding: 0;
                margin: 0;
                font-family: var(--serif);
                font-size: 12pt;
                line-height: 14pt;
                box-sizing: border-box;
            }
            
            @page {
                position: relative;
                width: 210mm;
                height: 297mm;
                min-height: 297mm;
                margin: 1.5cm;
            }

            table {
                border-collapse: collapse;
            }
            
            .page {
                width: 210mm;
                max-width: 100%;
                min-height: 297mm;
                margin: 0 auto;
                display: flex;
                flex-direction: column;
                justify-content: space-between;
                page-break-after: always;
            }

            .page:last-child {
                page-break-after: avoid;
            }

            .serif * {
                font-family: var(--serif);
            }

            .sans-serif * {
                font-family: var(--sans-serif);
            }

            .full-width {
                width: 100%;
            }

            .table-bordered {
                border-top: 1.2pt solid var(--base-border-color);
                border-bottom: 1.2pt solid var(--base-border-color);
            }

            .table-striped tr:nth-child(odd) td {
                background-color: var(--base-background-color-light);
            }

            .text-center {
                text-align: center !important;
            }

            .text-left {
                text-align: left !important;
            }

            .text-dimmed {
                color: var(--base-font-color-light);
            }

            .text-small, .text-small * {
                font-size: 8pt;
                line-height: 10pt;
            }

            .text-italic {
                font-style: italic;
            }

            .text-left {
                text-align: left !important;
            }

            .text-right {
                text-align: right !important;
            }

            .text-justify {
                text-align: justify !important;
            }

            .text-bold {
                font-weight: bold;
            }

            .mt-xs  { margin-top: 3pt; }
            .mt-sm  { margin-top: 6pt; }
            .mt-md  { margin-top: 9pt; }
            .mt-lg  { margin-top: 12pt; }
            .mt-xl  { margin-top: 18pt; }
            .mt-xxl { margin-top: 24pt; }
            .mb-xs  { margin-bottom: 3pt; }

            .mb-md  { margin-bottom: 9pt; }
